/* /components/Layout.js */

import React, { useContext, useState } from "react";
import Head from "next/head";
import logo from "../imagesRestaurant/logo.png";
//Styling
import {
  Collapse,
  Container,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  NavbarText,
} from "reactstrap";
import { useAuth } from "../lib/auth2";

const Layout = (props) => {
  const title = "Welcome to Nextjs";
  var { user, setUser, logout } = useAuth();
  const toggle = () => setIsOpen(!isOpen);
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div>
      <Head>
        <title>{title}</title>
        <meta charSet='utf-8' />
        <meta
          name='viewport'
          content='initial-scale=1.0, width=device-width'
        />
        <script src='https://js.stripe.com/v3' />
        <script
          src='https://cdn.jsdelivr.net/npm/bootstrap@5.1.3/dist/js/bootstrap.bundle.min.js'
          integrity='sha384-ka7Sk0Gln4gmtz2MlQnikT1wXgYsOg+OMhuP+IlRH9sENBO0LRn5q+8nbTov4+1p'
          crossOrigin='anonymous'></script>
      </Head>

      <style jsx>
        {`
          a {
            color: white;
          }
          h5 {
            color: white;
            padding-top: 11px;
          }
        `}
      </style>
      <Navbar className='navbar navbar-light navbar-expand-md'>
        <NavbarToggler onClick={toggle} />
        <NavbarBrand href='/'>
          <img
            alt='NP'
            src='logo.png'
            style={{
              height: 40,
              width: 40,
            }}
          />
        </NavbarBrand>
        <Collapse
          isOpen={isOpen}
          navbar>
          <Nav
            className='me-auto'
            navbar>
            <NavItem>
              <NavLink href='/display'>Display</NavLink>
            </NavItem>
            <NavItem className='ml-auto'>
              {user ? (
                <h5>{user.username}</h5>
              ) : (
                <NavLink href='/register'>Sign Up</NavLink>
              )}
            </NavItem>
            <NavItem>
              {user && <NavLink href='/profile'>Profile</NavLink>}
            </NavItem>
            <NavItem>
              {user ? (
                <NavLink
                  href='/'
                  onClick={() => {
                    logout();
                    setUser(null);
                  }}>
                  Logout
                </NavLink>
              ) : (
                <NavLink href='/login'>Sing In </NavLink>
              )}
            </NavItem>
          </Nav>
        </Collapse>
      </Navbar>

      <Container fluid>{props.children}</Container>
    </div>
  );
};

export default Layout;
